import React from 'react';
import Fade from "react-reveal/Fade";


export default function CategorySearch(props) {

    const goToFashion=()=>{
        props.history.push(`/fashioncategory`)
      }
    const goToVision=()=>{
        props.history.push(`/visioncategory`)
      }
    const goToSouls=()=>{
        props.history.push(`/soulscategory`)
      }

    return (
        <Fade bottom cascade={true}>
      <div className="authContainer">
        <div className="form1">
            <div> <button onClick={goToFashion}>Fashion</button></div>
            <div><button onClick={goToVision}>Visions</button></div>
            <div><button onClick={goToSouls}>Souls In a Box</button></div>



        </div>
      </div>
    </Fade>
    )
}
